const Carousel = () => {
  return (
    <Glide>
      <div data-glide-el="track" className="glide__track">
        <ul className="glide__slides">
          <li className="glide__slide" />
          <li className="glide__slide" />
          <li className="glide__slide" />
        </ul>
      </div>
    </Glide>
  );
};

export default Carousel;
